import React from 'react';
import image from '../public/heart.png';
class Profile extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            img:"../public/heart.png",
            name: "kittty"
        }
    }


    render(){
        return (
            <div>
                <img src={image} ></img>
                <h1>{this.state.name}</h1>
            </div>
        );
    }
}
export default Profile;
